import React from "react";
import Theme from "./Theme";
import Profile from "./Profile";
import Social_Media from "./Social_Media";
import Tech_Stack from "./Tech_Stack";
import Certification from "./Certification";
import Education from "./Education";
const Card = () => {
  return (
    <div className="w-full h-full text-black flex">
      <div className="w-1/4">
        <Theme />
        <Profile />
        <Social_Media />
        <Tech_Stack />
        <Certification />
        <Education />
      </div>
      <div className="w-3/4 bg-slate-400 shadow-lg shadow-white-500/50 rounded-sm mt-3 ml-3 text-white font-bold flex">
      <span className="ml-3 mt-3 text-2xl font-medium">Github Projects</span><span className="ml-auto font-light mr-3 mt-3"><a className="hover:underline hover:font-normal" href="">See All</a></span>
      </div>
    </div>
  );
};

export default Card;
